DROP TABLE IF EXISTS `conductlandview`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` VIEW `conductlandview` AS SELECT 
conduct.ID,
conduct.LandID,
landview.ID as LID,
conduct.Credit,
conduct.Degree,
conduct.StandardId,
standard.Name as stName,
conduct.Score,
landview.Name,
landview.ContractNumber,
landview.sName
from (conduct inner join standard on conduct.StandardId=standard.ID) inner join landview on conduct.LandID=landview.ID ;

-- 导出  视图 faith.conductview 结构
-- 移除临时表并创建最终视图结构
DROP TABLE IF EXISTS `conductview`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` VIEW `conductview` AS SELECT 
conduct.ID,
conduct.CreateTime,
conduct.Content,
conduct.Remark,
conduct.Credit,
conduct.Degree as creditDegree,
conduct.StandardId,
conduct.Score,
conduct.DataId,
conduct.SystemData,
conduct.State,
conduct.UserID,
standard.Name as sName,
enterprise.Name,
enterprise.Good,
enterprise.`Less`,
enterprise.Bad
from (conduct inner join standard on conduct.StandardId=standard.ID ) inner join enterprise on conduct.DataId=enterprise.ID where conduct.SystemData=0
union
select
conduct.ID,
conduct.CreateTime,
conduct.Content,
conduct.Remark,
conduct.Credit,
conduct.Degree as creditDegree,
conduct.StandardId,
conduct.Score,
conduct.DataId,
conduct.SystemData,
conduct.State,
conduct.UserID,
standard.Name as sName,
lawyer.Name,
lawyer.Good,
lawyer.`Less`,
lawyer.Bad
from (conduct inner join standard on conduct.StandardId=standard.ID  ) inner join lawyer on conduct.DataId=lawyer.ID where conduct.SystemData=1 ;

