DROP TABLE IF EXISTS `scores`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`%` VIEW `scores` AS SELECT 
enterprise.ID,
enterprise.Name as ELName,
000 as SystemData,
(select count(*) from land where land.SystemData=0 and land.ELID=enterprise.ID) as Times,
(select sum(conduct_standard_view.Score) from conduct_standard_view where conduct_standard_view.SystemData=0 and conduct_standard_view.ELID=enterprise.ID and conduct_standard_view.State=2 ) as ScoreValue,
