lawyer.ID,
lawyer.Name as ELName,
001 as SystemData,
(select count(*) from land where land.SystemData=1 and land.ELID=lawyer.ID) as Times ,
(select sum(conduct_standard_view.Score) from conduct_standard_view where conduct_standard_view.SystemData=1 and conduct_standard_view.ELID=lawyer.ID and conduct_standard_view.State=2 ) as ScoreValue,
(select sum(landrecord.Score) from landrecord where landrecord.SystemData=1 and landrecord.ELID=lawyer.ID) as record
from lawyer ;

